const burgerReducer = (state = [], action) => {
  switch (action.type) {
    case "NEW":
      if (state[0]) {
        return state;
      } else {
        return [
          ...state,
          {
            id: 1,
            name: "bun top",
            image:
              "data:image/jpeg;base64,",
          },
          {
            id: 2,
            name: "bun bottom",
            image:
              "data:image/jpeg;base64,",
          },
        ];
      }

    case "BEEF":
      return [
        ...state,
        {
          id: 3,
          name: "beef",
          image:
            "data:image/jpeg;base64,",
        },
      ];
    case "CHICKEN":
      return [
        ...state,
        {
          id: 4,
          name: "chicken",
          image:
            "data:image/jpeg;base64,",
        },
      ];
    case "CHEESE":
      return [
        ...state,
        {
          id: 5,
          name: "cheese",
          image:
            "data:image/jpeg;base64,",
        },
      ];
    case "ONION":
      return [
        ...state,
        {
          id: 6,
          name: "onion",
          image:
            "data:image/jpeg;base64,",
        },
      ];
    case "TOMATO":
      return [
        ...state,
        {
          id: 7,
          name: "tomato",
          image:
            "data:image/jpeg;base64,",
        },
      ];
    case "LETUCE":
      return [
        ...state,
        {
          id: 8,
          name: "letuce",
          image:
            "data:image/jpeg;base64,",
        },
      ];
    case "UNDO":
      return state.slice(0, -1);
    case "RESET":
      return (state = []);
    default:
      return state;
  }
};

export default burgerReducer;
